import React from "react"
class Item extends React.Component {

    render() {
        var { task, index } = this.props
        return (
            <tr>
                <td>{index}</td>
                <td>{task.name}</td>
                <td >
                    <p className={task.status === true ? 'text-danger' : 'text-succes'}>{task.status === true ? 'kích hoạt' : 'ẩn'}</p>
                </td>
                <td>
                    <button className="btn btn-succes">Sửa</button>
                    <button className="btn btn-danger">Xóa</button>
                </td>
            </tr >



        )
    }
}

export default Item
